let styles = {
    color: "yellow",
    backgroundColor: 'pink',
    display: 'flex',
    justifyContent: 'center',
    textShadow: '0px 10px 10px blue',
    fontFamily: '"monospace" , "poppins"'
}
function heading(){
    return (
        <h1 style={styles}>Yash Vasoya</h1>
    );
}
function Sum(a,b){
    let sum=a+b;
    return sum ;
}

function Sub(a,b){
    return a-b ;
}

function Div(a,b){
    let div=a/b;
    div=div.toFixed(2);
    return div;
}

function mul(a,b){
    return a*b ;
}

export default Sum;

export {Sub,Div,mul,heading};
